        "policy_additional": "I will only use your shipping and billing address, and contact information\n- To communicate with you about your order\n- To fulfill your order\n\nDOMESTIC SHIPPING:\n~REDUCED shipping rates will automatically calculate at checkout when more than one item is added to the cart~\n\n~All items will ship within 2-3 business days of the order being placed. We ship from Santa Rosa, California. Incomplete or incorrectly placed orders may result in a processing delay. \n\n~All shipments include a tracking number that will automatically be sent to the email linked to your Etsy account, when the shipping label is created.\n\n~We ship exclusively through USPS or Fed Ex.\n\n***Please note that Fed Ex cannot ship to PO Boxes***\n\nUNCOMMON BUT NOT UNHEARD OF PROBLEMS WITH DOMESTIC MAIL DELIVERY\nUNABLE TO DELIVER - If a package is returned to us after a delivery attempt by USPS due to an incorrect address provided on the order, the customer will be responsible for the cost of reshipping.\n\nLOST ORDER - We will replace your order at our expense if the tracking number does not show as \"delivered\" and there is no activity on a tracking number within 2 weeks of the ship date for U.S packages \n\nALSO - Please note that we cannot be responsible if the tracking number shows \"Delivered\", and you have not received it This is a USPS or Fed Ex issue, and you will need to contact them directly to file a claim.\n\nDAMAGED - If your item arrives damaged, please contact us within one week of the delivery date, with a photo.\n\nENGRAVING DISCLAIMERS\nWOOD & LEATHER ~ All wood and leather products contain a completely unique grain and hue. It is part of the appeal of a natural item. For this reason, please allow variation in engraving color and depth of these products. Knots and nicks are considered natural for these products\n\nGLASS ~ We order our glasses through American manufacturers and hand engrave each one to order. We check each glass prior to engraving for any noticeable flaws. As each glass is completely unique, please allow for small imperfections on the surface of the glass.\n\nLAYOUTS ~ We will try to honor all engraving requests, however there are some instances where a layout may not work as requested. We retain the right to use our discretion to make slight changes as needed.\n\nINTERNATIONAL SHIPPING POLICY\nIMPORTANT:\nDue to the changes in USPS International Shipping Policies, Orders that are deemed un-deliverable by the carrier or are not picked up in the allotted amount of time will be treated as abandoned. They will not be returned to us. They may however, be repurchased at a discounted price, please send us a PM to arrange this.\n\nLOST ORDER - We will replace your order at our expense if the tracking number does not show as \"delivered\" and there is no activity on a tracking number within:\n\n~ 4 weeks for Canada*\n~ 6 weeks for other international packages*\n\n*To account for customs delays\n\nIf tracking shows delivered, and you have not received the order, this is a USPS issue, please contact them directly to file a claim.\n\nDIGITAL PROOFS\nWe are happy to offer digital proof by request, on all items. Simply request this in the comments section at checkout, when the order is placed. We unfortunately cannot offer proofs without an order being placed first.\n\nDigital proofs are usually sent within 24-48 hours of the order being placed, though it may be slightly longer during peak holiday times due to order volume.\n\nOnce the final proof is approved, the processing time of 2-3 business days will begin. \n\nNOTE: If you are in a rush for your order, it is not recommended to request a proof as it can add up to 24-48 hours onto the processing time.\n\nCOMMUNICATION, COPYRIGHTS AND WHOLESALE OPPORTUNITIES\nCOMMUNICATIONS\n~We only respond to communication via Etsy convo, per Etsy recommendations. This creates a permanent record of communication and protects both the buyer and seller. Outside emails, telephone calls or other communications will not be replied to or acknowledged.\n\nCOPYRIGHTS AND INTELLECTUAL PROPERTY\n~ We retain full copyright of our photos, designs, layouts and intellectual property. \n\n~ Using our photos, designs, layouts, or plagiarizing our listings is an infringement on these copyrights and will not be permitted.\n\nWHOLESALE OPPORTUNITIES\n~ We offer wholesaling partnerships to select boutiques who we think would be a good fit for our brand. PM me if you would like to fill out an application to resell our products!\n\nCONFISCATED INTERNATIONAL SHIPMENTS\nCONFISCATED INTERNATIONAL SHIPMENTS: \n- While we know many countries import laws, that we ship to regularly, our knowledge is not exhaustive. By purchasing an item in our shop, you are acknowledging that it can be legally imported into your country. We will declare proper item value and descriptions when shipping, but are not responsible for items confiscated by customs officials due to import violations. \n\n- If you are uncertain of your country's import restrictions, please use this link: http://pe.usps.com/text/imm/ab_toc.htm\n\nEXPRESS SHIPPING\nExpress Shipping is available as an option at checkout for many of our items. Please note that the processing time will still be 2-3 business days, plus the express shipping transit time (which will be stated at checkout).\n\nIf you need it sooner than that, please convo me. We can arrange for 2-Day or overnight shipping and rush processing to work within your timeline. Pricing is dependent on delivery zip code and how soon it is needed.",
