      "description": "The Legend Has Retired 2017\nOur newest addition to our retirement etched glass collection.  This glass makes a wonderful retirement gift for him or retirement gift for her.  If you&#39;d like to personalize it by adding a name to the back, please include the recipient&#39;s name in the notes to seller section during the checkout process.\n\nIf this glass isn&#39;t what you&#39;re looking for, please visit the &quot;retirement&quot; section of our shop at: https://www.etsy.com/shop/PersonalizedGiftsUS?ref=hdr_shop_menu&section_id=19936704\n\n\nCare Instructions:\nThis design is available as an etched rocks glass, there are no special care instructions. The etching is permanent and it is dishwasher safe, you can care for this glass as you would any other glassware.\n\n\n-     -     -     -     -     -     -     -     -     -     -     -     -     -     -     -     -     -     -\nProcessing time:  Our processing time is normally 3-7 business days.  Our business days are Monday - Friday.  Although we can typically be reached on weekends through messaging, we do not count the weekends into our processing time.  If you have an urgent &quot;need by&quot;, please include this information in the notes to seller section during the checkout process AND send us a message through Etsy.  We do not always see the notes with the order right away, so messaging is best to let us know of an urgent order request.\n\nShipping time:  Time in transit needs to be taken into consideration as well.  Most locations are 2-3 days in transit, but up to 5 days.  Your delivery date will of course combine our processing time and time in transit.  Please be sure to allow for this time when placing your order or contact us immediately if there is an urgent need.\n\nDelivery Date:  Although we cannot promise a specific delivery date (transit time is not something we are able to control) please consider our processing time + shipping time for a close estimation for a delivery date.\n\nThank you for shopping with us, we look forward to helping you with your gift needs!",
