        "title": "Personalized Gifts US",
        "announcement": "Welcome! We specialize in birthday, retirement & all occasion wine glasses, beer mugs, rocks glasses and more!  You&#39;ll find a variety of designs, etched glasses and vinyl designs in color.  Thank you so much for visiting our shop today, we look forward to the opportunity to help you with your gift needs.  If you may have a custom request or have an urgent &quot;need by date&quot;, please message us directly.\nHappy Shopping!\nKris",
        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": "Happy Holidays!!  We will open our shop back up in a few days.  We&#39;re currently not accepting new orders while we&#39;re working on our current work load.  Please message us with any questions about your current order or a potential new order.\r\nThank you from your friends here at Personalized Gifts US, happy holiday season!",
        "sale_message": "Thank you so much for your order placed with us today, we sincerely appreciate the opportunity to help you with your gift needs.  \r\n\r\nPlease be sure to keep your original receipt sent through Etsy at the time of purchase.  Since many of our packages are sent directly to the gift recipients we do not include a receipt in the packages.  If you&#39;d like to include a gift note with your order please feel free to message us through Etsy and we&#39;ll be sure to include the note with your package.  Keep in mind, the return address listed on the package is ours so the recipient will not automatically know who the package is from.\r\n\r\nAdditionally, please take note of the processing time with your order, if there is an urgent need for faster processing, please contact us immediately.  \r\n\r\nWe know that there are many choices out there, we sincerely thank you for choosing to work with us for your gift needs, we&#39;re honored you chose us!\r\nThank you from your friends at Personalized Gifts US\r\nKris, Aaron & Mya",
        "digital_sale_message": null,
