        "listing_active_count": 143,
        "digital_listing_count": 0,
        "login_name": "personalizedgiftsus",
        "accepts_custom_requests": true,
        "policy_welcome": null,
        "policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
        "policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nESTIMATED SHIPPING TIME\nUnited States: 3 - 7 business days\n\nI'll do my best to meet these shipping estimates, but cannot guarantee them. Actual delivery time will depend on the shipping method you choose.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
        "policy_refunds": "I DON'T ACCEPT RETURNS, EXCHANGES, OR CANCELLATIONS\nBut please contact me if you have any problems with your order.",
        "policy_additional": "I will only use your shipping and billing address, and contact information\n- To communicate with you about your order\n- To fulfill your order\n- For legal reasons (like paying taxes)\n\nCARE INSTRUCTIONS\nWith our designs made with vinyl adhesive, please hand wash only with mild soap and pat dry.  Do not pick at or scrub or rub the lettering areas dry, this will likely damage the design.  Our glasses created with vinyl adhesive ARE NOT dishwasher safe.\n\nOur etched designs do not require any special care. YES, they can be put in the dishwasher and be completely safe.  With our etched glasses, you&#39;d care them just as you would any other glassware.  They will not scratch, fade or come off if soaked or ran through the dishwasher.  The design is permanently etched into the glass.\n\nCAN I CHANGE THE BIRTH DATE OR YEAR ON A BIRTHDAY GLASS YOU HAVE LISTED?\nYes! Our designs are all able to be customized to meet your specific needs. Please just make a note in the notes to seller section during checkout to change a year or age on a birthday glass. Since we don&#39;t create separate listings for every possible birthday, this is a great alternative.\n\nCUSTOM AND PERSONALIZED ORDERS\nWe are more than happy to put your thoughts into a design or help you come up with a design concept.  We&#39;ll gather your ideas and put together a proof - from there we determine what you do or don&#39;t like about it and proceed from there to create your vision!\n\nWHAT IF I HAVE AN ISSUE WITH MY ORDER ONCE I RECEIVE IT.\nIf you have an issue of any kind with your order once you receive it, please contact us within 48 hours of delivery. \n \nBroken item upon receipt: Please send us pictures of the broken item as well as the box from all sides, within 48 hours of delivery.\n\nWrong design color or glass style received:  If your order received is different from what you ordered, please contact us with pictures of what you received.  If you ordered multiple glasses, we will need a photo with your full order in one photograph. We work hard to not make mistakes such as this, however we are human and they do happen.  We will send replacements at our expense to ensure that you receive the order as placed.",
