        "sale_message": "Thank you for your order! By making a purchase, you acknowledge and accept all store policies, terms and conditions, and agree that you have read all of the information in the Item Details section of the listing you purchased. Digital printable files can be printed many times, added to photo books, used to create photo gifts, shared on social media (must tag photos with #PRINTSbyMAdesign), etc... so have fun and enjoy your digital print!  If you happen to get a photo of it displayed, I’d love to see it!  Thank you!\r\n\r\nMary Anne\r\n{PRINTS} by MA design\r\nfacebook.com/MAonEtsy\r\nPRINTS-MAdesign.com\r\nweddingwire.com/PRINTSbyMAdesign\r\n\r\n**Digital printable file(s) should either be uploaded to a print lab&#39;s website or taken in by a thumb drive. You may not be able to take your mobile device to a print lab and be able to have your file(s) accessed for printing.  \r\n\r\n►►► INSTANT DOWNLOADS: Instant Downloads come exactly as seen in the previews since they are pre-loaded into Etsy -- no changes can be made to Instant Downloads. They are sent to the email address linked to the buyer&#39;s Etsy account (the files will not be sent to any other address). Here is an article on Instant Downloads: https://www.etsy.com/help/article/3949\r\n\r\n►►► CUSTOMIZED ORDERS: Provide all information needed to customize your digital printable file immediately (see the &quot;Item Details&quot; section of the listing you purchased for all required info). If the final ship date arrives but all info has not been provided, the digital printable file will be sent with any info that was provided.\r\n• Orders placed after 4pm EST or on weekends/national holidays count as being placed at 9am the following business day.\r\n• This shop receives a high volume of orders. Unless a Rush Order is purchased in addition to the custom listing, all orders are completed in the order they are received.\r\n• If you need a PDF rather than a JPG, please request one immediately. \r\n• Custom orders are saved on my computer and in my Google Drive for 14 days from the date it was sent to the customer. After 14 days it will be deleted in order to make room for new files.  If your file needs to be resent after 14 days, a new purchase must be made since it will need to be completely redone.\r\n\r\nIMPORTANT INFO\r\n• SHOP POLICIES: https://www.etsy.com/shop/PRINTSbyMAdesign/policy\r\nAdditional Shop Policies: https://www.etsy.com/shop/PRINTSbyMAdesign/about\r\n• PRINTING INFO: https://www.etsy.com/shop/PRINTSbyMAdesign/about\r\n• COMMUNICATION is done via Etsy Conversation only (not email or phone).\r\n• PRINT RELEASE FORM: https://drive.google.com/file/d/0BxSkwfWphcHRVnNwR01JSmthWVE/view?usp=sharing\r\n• ALL SALES ARE FINAL - no cancellations, refunds and/or exchanges\r\n• Per Etsy&#39;s Terms of Use, customers are responsible for reading all Item Descriptions and Shop Policies prior to purchase: https://www.etsy.com/legal/buyers/?ref=list#purchasing\r\n\r\n🚫 CLOSED all weekends and US national holidays in accordance to bank holidays: http://www.theholidayschedule.com/bank-holidays.php\r\n\r\n----- DIGITAL PRINTABLE FILES ONLY -----\r\n\r\n~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~~\r\n\r\n{PRINTS} by MA Design can be found on WeddingWire.com. Wedding product reviews are GREATLY appreciated!!! \r\nhttps://www.weddingwire.com/review/PRINTSbyMAdesign",
