        "policy_additional": "I will only use your shipping and billing address, and contact information\n- For legal reasons (like paying taxes)\n\nHOURS OF OPERATION & TURN AROUND TIME\n► HOURS OF OPERATION: M-F, 9am-4pm EST. CLOSED weekends & US national holidays in accordance to bank holidays: http://www.theholidayschedule.com/bank-holidays.php  Orders placed on a weekend/national holiday count as being placed the following business day.\n\n► CURRENT TURN-AROUND TIME: about 2 business days\n• Because of the large volume of orders received, custom orders may take a few days to be completed & sent to the customer. If you need a custom order FAST, please purchase a Rush Option in addition to the custom digital printable file: www.etsy.com/listing/238321043/rush-order-choose-how-fast-you-want-your \n• To ensure a quick turn-around, provide ALL required customization information (see the Item Details section of the listing)\n\nWHAT IS A DIGITAL PRINTABLE FILE, AND WHY WOULD I WANT A DIGITAL PRINTABLE FILE INSTEAD OF A PHYSICAL PRINT?\nA digital printable file is a file (JPG or PDF) you can print yourself or have printed. This shop does not sell any physical prints.\n\nDigital printable files = print at your convenience, as many times as you want! No shipping fees, or worrying about anything getting damaged/lost in the mail. Choose where you want to have it printed (very cost effective) - print at a one-hour photo lab & you could potentially have it in your hands within hours of purchasing it! Print any size within the same aspect ratio, on the material you want (paper, poster board, canvas, metal, etc). Also, create photo gifts with your digital prints, add them to photo books, share on social media, etc!\n\nPRINTING INFO & TIPS\nPrint your digital printable file as many times as you want! Print different sizes (within the same aspect ratio), add to photo books, create photo gifts, share on social media, etc!\n*Digital files are for personal use only. You are welcome to print it for yourself or as a gift, but you CAN NOT resell it in part or whole - either in a digital or printed format.\n\nPrint your digital print just like a photograph (on white paper).  I suggest having it printed to save your printer ink!  Costco and Mpix.com are my two favorite places to print, but there are numerous other fantastic sources!  For a LOT of printing tips & info, please see the “ABOUT” section of my shop: https://www.etsy.com/shop/PRINTSbyMAdesign/about\n\nPRINT QUALITY INFORMATION\nPrints are High Resolution & High Quality. If you receive a LOW RESOLUTION warning, please see below:\n• CUSTOM PRINTS: make sure you DOWNLOAD the file - don’t simply save the preview (the download button will be at the top center of the screen after you click the name of your file). \n• My digital prints are high resolution & larger than they need to be in order to print high quality. If your print appears blurry, please go back and make sure you downloaded it correctly.\n• If you&#39;re given a choice of upload speeds when uploading, NEVER CHOOSE THE FAST OPTION! This will reduce the quality of the print since they are very large. By default, the fast upload option is often selected, so make sure you choose the option for large prints.\n\nPRINT RELEASE & POSTING TO SOCIAL MEDIA INFO\nA Print Release Form grants the buyer permission (a release) from the print owner (the shop) to print images provided. It does not include rights to edit or alter the image, sell them, etc. That right remains with the print owner (the shop).  A print release form is sent with every single order - check the email you received with your order.\n\nIf you post any digital files purchased from my shop to social media, please give me credit by using the web address PRINTSbyMAdesign.etsy.com and the hashtag #PRINTSbyMAdesign\n\nINSTANT DOWNLOAD INFORMATION\nInstant Download digital printable files are prints that are delivered via Etsy and printed by the buyer. What is received is exactly what is seen in the previews - no changes can be made since these files are pre-loaded into Etsy & sent to the customer from Etsy (not from the shop). \n• Download links are sent from Etsy (not the seller) to the email address linked to the buyer&#39;s Etsy account as soon as payment clears. No files will be emailed separately by the shop. Also access the download link under &quot;Purchases&quot; https://www.etsy.com/your/purchases\n• For more info: https://www.etsy.com/help/article/3949\n• ALL SALES ARE FINAL - no cancellations, refunds, or exchanges.\n\nPROOFS ARE BY REQUEST ONLY\n• Proofs must be requested on an order (in the Note to Seller box).\n• Proofs are only sent through Etsy Conversations after ALL info is received. The final high-res digital file will be emailed ASAP once the proof is approved.\n• Proofing includes minor changes only (es: spelling error). Proofing does NOT include major changes, including, but not limited to: resizing, creating a completely new print, changing any text (not pertaining to the customer&#39;s custom info), rearranging or reworking the design, etc. \n• 2 free proofs per custom order. Additional revisions can be purchased here: https://www.etsy.com/listing/228710896/extra-revision-additional-proof\n• Proofs are sent after payment clears\n• Proofs are provided for custom orders only\n\nFILE TYPES - JPG, PDF, BLEED, ETC\nJPGs and PDFs are two different types of digital files.  The only reason why you&#39;d need one vs the other is because different print labs require different file types. Most print labs require JPGs, and therefore this shop sends JPGs unless a PDF is requested.  If you need a PDF, it must be requested when the order is placed.  If you need to have a bleed around your print (your print lab will tell you this), this must be requested at the time of the sale.\n\nDIGITAL PRINTABLE FILES ONLY - NO PHYSICAL PRINTS\nNO PHYSICAL ITEMS WILL BE SENT! Once your digital printable file(s) has been sent to you via email, you will receive a &quot;shipping confirmation&quot;. This confirmation is only to verify that your order has been completed (nothing will be sent to your physical address). If you have not received the email with your download link, yet you know it was sent, please check your spam folder. Completed orders can also be accessed under &quot;Purchases&quot;: https://www.etsy.com/your/purchases\n\nALL SALES ARE FINAL - NO CANCELLATIONS OR REFUNDS.\nNO CANCELLATIONS or REFUNDS\n\nPer Etsy&#39;s Terms of Use, customers are responsible for reading all Item Descriptions and Shop Policies prior to purchase: https://www.etsy.com/legal/buyers/?ref=list#purchasing\n\nBy purchasing from this shop, you acknowledge and agree to the Shop Policies and Terms of Use.\nhttps://www.etsy.com/shop/PRINTSbyMAdesign?ref=hdr_shop_menu#policies\nhttps://www.etsy.com/shop/PRINTSbyMAdesign/about\n\nExchanges *MAY* be possible for custom orders only - not on Instant Downloads. This will be determined on a case-by-case basis.\n\nCONTACTING THIS SHOP\nPlease contact this shop via Etsy Conversation only.\n\nDO NOT EMAIL - Email is not reliable since many times messages go to the Spam Folder. \n\nNo communication will be done via phone.",
