        "announcement": "Vintage inspired printable art. Unique wall art for every room and personality! Patent prints, vintage photos, quotes. Multiple sizes to download and print or order a print to be mailed.",
        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": "TypImage is coming soon with the most unique Typographic Art prints and images on Etsy! Sign up to be notified of our grand opening.",
        "sale_message": "Thank you for your purchase from TypImage Art. I hope you enjoy your new printable wall art. \r\n\r\nIf you have any questions, please contact me!",
        "digital_sale_message": "Thank you for purchasing this digital download from TypImage Art!\r\n\r\nI know you&#39;re going to love your unique print in your home or office. Please see  Etsy&#39;s download instructions which you should receive via email or here: https://www.etsy.com/help/article/3949\r\n\r\nDon&#39;t hesitate to contact me if you have any issues with downloading. Please remember to leave a review!\r\n\r\nThank you,\r\nLaura",
        "last_updated_tsz": 1489612596,
        "listing_active_count": 164,
