        "login_name": "lauraahardesty",
        "accepts_custom_requests": true,
        "policy_welcome": "Welcome to TypImage Art where we combine Type and Images in an artist way to create unique typography art prints that speak for you, for you home, office or dorm.\r\n\r\nFamous quotes, motivational messages and typography images custom designed to inspire, make you laugh & think. Wall decor for any space that reflects your personality.",
        "policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
        "policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs\n\nDIGITAL DOWNLOADS\nYour files will be available to download once payment is confirmed.",
        "policy_refunds": "I GLADLY ACCEPT RETURNS AND EXCHANGES\nJust contact me within: 14 days of delivery\nShip returns back to me within: 30 days of delivery\n\nI DON'T ACCEPT CANCELLATIONS\nBut please contact me if you have any problems with your order.\n\nTHE FOLLOWING ITEMS CAN'T BE RETURNED\nBecause of the nature of these items, unless they arrive damaged or defective, I can't accept returns for:\n- Custom or personalized orders\n- Perishable products (like food or flowers)\n- Digital downloads\n- Intimate items (for health/hygiene reasons)\n\nCONDITIONS OF RETURN\nBuyers are responsible for return shipping costs.\nIf the item is not returned in its original condition, the buyer is responsible for any loss in value.",
        "policy_additional": "I will only use your shipping and billing address, and contact information\n- To communicate with you about your order\n- To fulfill your order\n- For legal reasons (like paying taxes)\n\nHOW DO I DOWNLOAD MY PRINT?\nOnce you purchase a print you will receive an email with a link to download your item.\n\n**Etsy does not offer items to be downloaded using their app, so be sure to use your regular browser.\n\nIf you cannot find your download file(s) click on your profile icon and select Purchases and Reviews. Then you will see a Download button to the right of your purchase.\n\nPlease contact me if you have any issue in downloading. Or here is Etsy&#39;s page of helpful instructions: https://www.etsy.com/help/article/3949\n\nHOW DO I PRINT MY ARTWORK?\nPrintable wall art can be printed at home or sent out to your favorite photo printing service.\n\nUse the PDF version to easily print at home for smaller prints.\n\nUse the JPG to upload to online printing services such as Shutterfly or Costco.\n\nI recommend using a White Matte thick photo paper for both black and white and color artwork and images. If you like a little shine use the Luster paper, Glossy tends to be too shiny and detracts from your print.\n\nWHAT TYPE OF FILES WILL I RECEIVE?\nFor most prints you will receive JPG and PDF versions of the image. For some prints with a lot of &quot;imagery&quot; the PDF is too large to upload on Etsy. Just contact me if you would like a PDF to be sent.\n\nSizes vary, but many prints include:\n5x7   PDF\n8x10 PDF\n11x14 PDF\n16x20 JPG\n\nWHAT CAN I DO WITH MY PRINT?\nFrame it! Display it!\n\nYou may print as many copies as you wish for your personal use. This file is for non-commercial PERSONAL USE ONLY. You may not forward, share, sell or distribute the file. Copyright is retained by TypImage Art.\n\nSPECIAL SALE EVENTS\nSign up for special event sales just for TypImage Art customers, and advance notice of new art and public sales.\nhttp://eepurl.com/ctrBBj",
