        "title": "Personalized leather accessories, handmade in the USA!",
        "announcement": "All items ready to ship in 1 week, shipping takes 2-3 business days. Rush upgrades available!\nLarge order? We have discounts available here: http://etsy.me/1mfUkRw\nLet us make your gift shopping easier with $1 gift packaging: http://etsy.me/1U30zTY\n\nOur leather products are entirely handmade in our studio in the USA! Each item is crafted with genuine high quality full-grain leather and constructed to our rigorous quality standards to provide you with a sturdy, beautiful, and reliable bag or accessory that will last you a lifetime.\n\nAll orders ship within 1 week via USPS, or sooner if you select a rush upgrade at checkout. Standard shipping to US destinations takes 2-3 business days. Standard international shipping takes up to 15 business days. Tracking information will be provided once your order ships.",
        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": null,
        "sale_message": "Thank you for your purchase from Felix Street Studio! Your order will be carefully crafted and personalized to your specifications. We will review any notes included with your order and contact you through Etsy and email if we have any questions. \r\n\r\nAll orders ship within 1 week via USPS, or sooner if you selected a rush upgrade. Standard shipping to US destinations takes 2-3 business days. Standard international shipping takes up to 15 business days. Tracking information will be provided once your order ships. To check the status and ship date of your order, sign in to your Etsy account, click You, then click Purchases and reviews.\r\n\r\nWe really appreciate your business and your support of handcrafted goods!",
        "digital_sale_message": null,
        "last_updated_tsz": 1489612647,
        "listing_active_count": 127,
        "digital_listing_count": 0,
        "login_name": "FelixStreetStudio",
        "accepts_custom_requests": true,
        "policy_welcome": null,
        "policy_payment": "SECURE OPTIONS\nEtsy keeps your payment information secure. Sellers don't receive your credit card information.\n- Visa\n- MasterCard\n- American Express\n- Discover\n- PayPal\n- Apple Pay\n- SOFORT Bank Transfer\n- iDEAL\n- Etsy Gift Card",
        "policy_shipping": "PROCESSING TIME\nThe time I need to prepare an order for shipping varies. For details, see individual items.\n\nESTIMATED SHIPPING TIME\nNorth America: 2 - 3 business days\nEurope: 15 - 16 business days\nAustralia, New Zealand and Oceania: 15 - 16 business days\nAsia Pacific: 15 - 16 business days\nLatin America and the Caribbean: 15 - 16 business days\nNorth Africa and the Middle East: 15 - 16 business days\nSub-Saharan Africa: 15 - 16 business days\n\nI'll do my best to meet these shipping estimates, but cannot guarantee them. Actual delivery time will depend on the shipping method you choose.\n\nCUSTOMS AND DUTIES FEES\nBuyers are responsible for any customs or duties fees that may apply. Sellers aren't responsible for delays due to customs",
        "policy_refunds": "I GLADLY ACCEPT RETURNS AND CANCELLATIONS\nJust contact me within: 14 days of delivery\nShip returns back to me within: 30 days of delivery\nRequest a cancellation within: 12 hours of purchase\n\nI DON'T ACCEPT EXCHANGES\nBut please contact me if you have any problems with your order.\n\nTHE FOLLOWING ITEMS CAN'T BE RETURNED\nBecause of the nature of these items, unless they arrive damaged or defective, I can't accept returns for:\n- Custom or personalized orders\n\nCONDITIONS OF RETURN\nBuyers are responsible for return shipping costs.\nIf the item is not returned in its original condition, the buyer is responsible for any loss in value.",
        "policy_additional": "I will only use your shipping and billing address, and contact information\n- To communicate with you about your order\n- To fulfill your order\n- For legal reasons (like paying taxes)\n\nHOW LONG WILL IT TAKE TO RECEIVE MY ORDER?\nOrders ship within 1 week via USPS. Standard shipping to US destinations takes 2-3 business days. Standard international shipping takes up to 15 business days. Rush upgrades are available at checkout if you need your order sooner.\n\nCAN YOU GIFT WRAP MY ORDER? CAN I INCLUDE A GIFT NOTE?\nWe offer gift packaging for $1. You can add it to your order here: http://etsy.me/1U30zTY\n\nWe are happy to include a gift note! Please tell us what you would like it to say in the notes at checkout.\n\nWe do not include printed receipts or invoices in our shipments, so they are safe to ship directly to the recipient.\n\nDO YOU PROVIDE DISCOUNTS FOR LARGER ORDERS?\nYes we do! We offer a 15% discount for orders of 3 or more bags. You can view all of our discounted listings in the Groomsmen Sets section of our shop here: http://etsy.me/2asgyNV\n\nIf you are interested in ordering 30+ items, please contact me to discuss pricing.\n\nCAN YOU ADD MY LOGO TO AN ITEM?\nYes we can! We offer custom embroidery and embossing options for logos. Embroidery (design created in thread, can include multiple colors) requires a one-time fee of $30, and embossing (design imprinted in leather with a heat press, does not include color) requires a one-time fee of $80. Both options add one week to lead time. \n\nPlease contact me to have a custom listing set up!\n\nHOW DO I SPECIFY PERSONALIZATION?\nDuring the checkout process, there will be a notes box where you can type all personalization instructions.",
