        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": "Thank you for visiting our shop! Our local area including our business and home was forced to evacuate due to Hurricane Matthew.  Although the evacuation order has now been lifted, we are still without power.  It is expected to be restored very soon.  As soon as power is restored we will resume production and ship standing orders as quickly as possible. Once power is restored, we will begin accepting new orders again as well.  Please feel free to message any questions between now and then, and we will answer back as soon as we can (please allow up to 72 hours for a response during this time).  We sincerely apologize for any inconvenience, but look forward to doing business with you as soon as we return!",
        "sale_message": "Thank you so much for your recent order!  We have received it and will begin processing as soon as possible.  Once your order is completed you will receive a shipping notification along with tracking information for your package so that you can track it all the way to you.  Thank you again for your order.  Your business is greatly appreciated!",
        "digital_sale_message": null,
