      "title": "Personalized Rocks Glasses, SHIPS FAST, Etched Rocks Glasses, Custom Rocks Glasses, On The Rocks Glasses, Engraved Rocks Glass, Any Quantity",
      "description": "Personalized Wedding Whiskey Glasses, Groom Gift, Toasting Glasses, Groomsmen Glasses, Custom Wedding Gift, Engraved Wedding Rocks Glasses\r\n\r\nThis listing is for one personalized etched whiskey glass, which will have your choice of monogram style and lettering permanently etched into the glass.\r\n\r\n\r\n...DETAILS...\r\n~ Includes one 8 oz &quot;rocks&quot; whiskey glass\r\n~ Glasses are dishwasher safe\r\n~ Etching is permanent and requires no maintenance\r\n~ Every glass comes carefully packaged\r\n~ Each glass can have different text\r\n\r\nFeel free to order any quantity as shipping will automatically combine at checkout.\r\n\r\nShips out in 2-3 business days per current shop turnaround times which can be found here:\r\nhttps://www.etsy.com/shop/FrederickEngraving/policy\r\n\r\n... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ...\r\n\r\nOur other many kinds of personalized glassware can be found here:\r\nhttps://www.etsy.com/shop/FrederickEngraving?section_id=13811371&ref=shopsection_leftnav_5\r\n\r\n... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ...\r\n\r\n\r\n**HOW TO FORM YOUR MONOGRAM**\r\n\r\nTraditionally, the first name initial is on the left, with the last name initial in the center and the middle name initial on the right. \r\nFor example, &gt;&gt;&gt;&gt;Katie Marie Jones would look like K J M&lt;&lt;&lt;&lt;\r\n\r\n\r\n... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ...\r\n\r\n\r\n...TO ORDER...\r\n\r\n1. Select your options from the drop down menu.\r\n2. During checkout, in the &quot;note to seller&quot; section, provide:\r\n...~ Each monogram exactly as you want it to appear.\r\n\r\n*Please note that I do not rearrange initials to create monograms, I will engrave exactly as it is written*\r\n\r\nShips per current shop turnaround times which can be found here:\r\nhttps://www.etsy.com/shop/FrederickEngraving/policy\r\n\r\n... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ...\r\n\r\n\r\n...IMPORTANT...\r\n\r\nI know how important it is to have your custom piece as soon as possible. With such a fast turnaround time, I usually start designing your custom piece within hours from when the order is placed. For that reason I am unfortunately unable to accommodate changes to the order or shipping address once it has been placed.\r\n\r\nMobile phones do not allow selection from drop down menus. Please provide your choices in the &quot;notes&quot; section at checkout if you have a preference. \r\n\r\nPlease note that not providing required information at checkout may delay your order. Processing time begins when all required information is submitted. Digital proofs are available upon request. Processing time begins when the final proof is approved.\r\n\r\n... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ...\r\n\r\n\r\n...CANCELLATION / RETURN POLICY...\r\n\r\nIf your item has not been engraved yet, I am happy to cancel the order for you. However, due to my fast turnaround time, they are usually engraved the morning after the order is placed. If your order has been engraved, it will be shipped and ineligible for a cancellation or a refund.\r\n\r\nAs each custom piece is made to order just for you, understandably I cannot accept returns. Please make sure to ask any questions that you have before placing the order.\r\n\r\n... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ...\r\n\r\n\r\n...EXPEDITED SHIPPING...\r\n\r\nAvailable by special request. Convo me with the date you need the item by PRIOR to placing the order, and I will let you know what expedited options are available. Prices vary depending on how soon it is needed.\r\n\r\n... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ... ...\r\n\r\n\r\nAdditional questions? Most can be answered be reading my shop policies here:\r\nhttps://www.etsy.com/shop/FrederickEngraving/policy\r\n\r\nFor more personalized items, see my shop here: \r\nhttps://www.etsy.com/shop/FrederickEngraving",
