      "title": "Clear Coat! -Jack Daniels Whiskey Soap Dispenser or Spray Bottle / Bathroom Soap Pump Bottle / Kitchen Glass Soap Dispensers Birthday Gifts",
      "description": "Perfect gift for your girlfriend, boyfriend, dad or a whiskey lover!  Glass soap dispensers are a trendy way to add to your kitchen decor, bathroom decor, home bar or man cave.  \n\nChoose your bottle! Order a Jack Daniels Whiskey bottle soap dispenser, a spray bottle or both?!  Use the pump bottle to dispense hand soap, dish soap, cooking oil, olive oil, hand sanitizer, mouthwash...  The spray bottle could be used with hair products, cleaning products. Each bottle is CLEAR COATED to protect and increase the life of your label!\n\nYou will receive: 1 item unless you buy more\n* 1 Up-cycled Jack Daniels Whiskey Bottle (1 Liter)  ~12.5&quot; tall with pump \n* Stainless Pump Top:\n   - 4 styles available! (Use drop down menu)\n   - Real metal. Stainless finish.  NOT plated plastic!\n   - Durable, High Quality, CLEAR COATED to protect and increase the life of your label!\n\n** With gentle care your glass bottle can give enjoyment for quite some time! I&#39;ve been using my pump head daily for a year now but of course the life of your bottle/pump/spray head/bottle label can&#39;t be guaranteed and depends on how you use it.  \n\n** This item is made of glass and is up-cycled, so each bottle and bottle label/neck foil will have slight imperfections.  Bottles come with pump but may not come with original cap since they are up-cycled. \n\n** Be sure to click through all the great pictures!\n\n** I do custom orders!  Convo me if you need a large quantity, a different color Jack Daniels bottle or want me to make something you saw on Pinterest.**\n\n\n* CHECK OUT MY OTHER JACK DANIELS ITEMS: (Only a few listed below. Many more in my store!)\n\n- Jack Daniels candle in your choice of color and scent:\nhttps://www.etsy.com/listing/493433934/jack-daniels-candle-gift-handmade?ref=listings_manager_grid\n\n- 1 liter pump bottle - traditional BLACK Jack Daniels bottle:\nhttps://www.etsy.com/listing/294367083/large-jack-daniels-whiskey-soap?ref=listings_manager_grid\n\n-Same 1 liter Jack Daniels bottle but in Tennessee Fire RED! (when available)\nhttps://www.etsy.com/listing/453562154/large-jack-daniels-whiskey-soap?ref=listings_manager_grid\n\n- Jack Daniels SINGLE BARREL Soap Dispenser: \nhttps://www.etsy.com/listing/496125598/large-jack-daniels-single-barrel-whiskey?ref=listings_manager_grid\n\n- Occasionally I have Jack Daniels Tennessee Honey or the rare Jack Daniels Green Label bottles.  See my store or convo me to see if they are in stock! https://www.etsy.com/shop/LookingSharpCactus?ref=hdr_shop_menu§ion_id=19160368\n\n- Jack Daniels Planter with drainage and plants! (succulents) \nhttps://www.etsy.com/listing/261753325/jackdaniels-whiskey-bottle-planter?ref=listings_manager_grid\n\n- Jack Daniels snack bowl, empty planter with drainage or Jack Daniels vase:\nhttps://www.etsy.com/listing/265588847/jackdaniels-whiskey-bottle-bottle?ref=listings_manager_grid\n\n- Jack Daniels Mouthwash Dispenser:\nhttps://www.etsy.com/listing/481430153/mouthwash-dispenser-large-jack-daniels?ref=listings_manager_grid\n\n- Slightly smaller 750 ml Jack Daniels Soap Dispenser (A Great Deal!)\nhttps://www.etsy.com/listing/400262897/jack-daniels-whiskey-soap-dispenser-pump?ref=listings_manager_grid\n\n- Other whiskey bottles/gifts:\nhttps://www.etsy.com/listing/269216205/custom-whiskey-gifts-succulent-planter?ref=listings_manager_grid\n\n\n** Please hand clean items only.  \n\n** See my store for other up-cycled bottles turned into a lotion dispenser, soap dispenser, succulent planter, vase, candle holder, serving dish, snack bowl...\n\n** I also do custom orders and can provide the above items in bulk.\n\n** Do you have a favorite alcohol bottle?  Contact me to see if I have your favorite bottle in stock. \n\n** You can mail me your favorite bottle and I would be happy to make it into the perfect gift by turning your favorite bottle into a soap dispenser, succulent planter, vase, candle holder, serving dish, snack bowl ….  Just convo me for details! \n\n\nPlease visit my shop to see the creative things I&#39;m doing with alcohol bottles, wine bottles, air plants, succulents and even cactus!\nhttp://www.etsy.com/shop/LookingSharpCactus\n\n\nJack Daniels is a registered trademark and is not involved in or affiliated with the production or distribution of my handmade products.",
