        "title": "Handcrafted Gifts & Decor: Succulents & Upcycled Glass",
        "announcement": "With SO MANY different gifts to choose from please use the ITEM MENU on left side of this page to find just the right gift for yourself or that special someone.  I&#39;m also happy to do CUSTOM ORDERS.  You can mail me a special bottle to have professionally cut! Click through all the great pictures and to see the beautiful, SMOOTH EDGES my products have since I use COLD glass working techniques and expensive PROFESSIONAL EQUIPMENT.  Bulk orders are welcome.  Thank you for supporting a stay at home mama and her kiddos!",
        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": null,
