        "sale_message": "Congratulations on your purchase! We feel pleased and honored that you have chosen Magic Wood Shop. \r\nYour order is being processed by our professional team. You should be receiving a message with a tracking number once your order has been shipped.\r\nIf you have any questions, please email us at info@magicwoodshop.com. \r\nAgain, thank you for choosing Magic Wood Shop!",
