        "policy_welcome": "Welcome to Magic Wood shop where  clients meet and exceed their sales objectives. We’ll give you more than you expect and pay for. Our philosophy is that anything less is not good enough. In this manner, we hope to earn your confidence, trust, and continued business.\r\nWe specialize in highly personalized wedding gifts, custom cutting boards, cake toppers, vinyl decal signs, and other laser engraved gifts using our many unique designs or design of your own.  The current lead time for our products is 3-10 days plus time for shipping.\r\n Magic Wood makes individualized affecting gifts at reasonable price. We hope you will find your shopping experience here as enjoyable as we have. ",
        "policy_payment": "We provide safe and secure shopping experience for all our customers.\r\n\r\nAll major credit and debit cards are accepted: Visa, Discover, American Express, and Mastercard. \r\nYou can also pay using your  Etsy Gift Card.\r\n\r\nNew York  Residents Will be Charged State Sales Tax in the Amount of 8.875% Upon Checkout",
        "policy_shipping": "We are working hard to have your order shipped out as soon as possible. Please note that it will not always be on the same day the order was placed. Depending on our work load, the processing time may vary from 1 to 10 business days. Feel free to contact us if you would like to find out the lead time for a specific item you are interested in. \r\nNeed your items ASAP?? Purchase the &quot;Rush My Order&quot; listing below for your items to be processed and shipped within 1-2 business days:\r\nhttps://www.etsy.com/listing/197939890/rush-order-bump-me-to-the-front-of-the?ref=shop_home_active_19\r\n\r\nDOMESTIC SHIPPING\r\nWe use USPS First Class, USPS Priority mail, and FedEx Ground shipping destinations within the US. The amount of time it takes to receive the delivery depends on the carrier. Unfortunately, once the order leaves our workshop, we have no control over their accuracy or delays in shipping. You can find the estimated time for delivery on the carrier website.\r\n\r\nPlease make sure to you specified correct shipping address before completing check out as this is the exact address we will ship your order to.\r\n\r\nINTERNATIONAL SHIPPING\r\nAll international orders are shipped via USPS First Class Mail. Please note that you won’t be able to track your package once it leaves the U.S. using USPS tracking number provided. Delivery time varies by destination and depends on foreign Customs processing time. We are not responsible for lost, stolen, or damaged during the shipment items. Please be advised that all packages are insured. If you received damaged item, please contact us for further instructions on how to receive your compensation.\r\n \r\nCUSTOMS CHARGES\r\nIt is the customers responsibility to contact the local customs, the courier office regarding any additional and applicable customs, duties, or Vat charges.\r\n \r\nIf you have any questions or concerns, please do not hesitate to contact us",
        "policy_refunds": "REFUNDS AND EXCHANGES\r\n1.1 Personalized items.\r\nAll personalized item sales are final and  not subjects to refund or exchange. Please make sure that you provided us all order details and correctly entered all information before completing your purchase.  \r\nNOTE: Please remember to doublecheck your spelling as the wording will appear on the item exactly as you wrote it out when placing the order. We won&#39;t be responsible for incorrect spelling unless due to our negligence. The customer will have to pay again if he/she wants us to make another item with correct spelling.\r\n1.2 Non-personalized items. \r\nIf for  any reason, you are not satisfied with your purchase, you can send it back and receive a refund. The merchandise must be unworn and in the same condition it was received. Also, it must be returned in the original packaging. Please note that customer is responsible for all return shipping charges. Once your return is received, you will receive a refund for the amount you paid for the returned item (note: this does not include shipping charges). Refund will be made to the original method of payment.\r\n1.3 Damages.\r\nIf you received damaged item, please contact us for further instructions. Please attach a picture of the damaged item to your message.\r\n\r\n",
