      "description": "Shot Glasses from Sip Hip Hooray!!\n\nTake a Shot, Wedding Favors, We Tied the Knot Shot Glass, Personalized Shot Glasses, Wedding Shot Glasses, Custom Shot Glasses and Wedding Favors from Sip Hip Hooray!!\n\nCompletely Custom / Personalized / Monogrammed Shot Glasses!!  \n\nANY DESIGN!\nANY INK COLOR!\n\nWith our large selection of designs and ink colors your options are endless!\n \nDon’t see what you are looking for? We LOVE Custom Orders!\nAll shot glasses can be personalized for your event with colors, name, date and state changes available, making them the perfect addition to your big day!! \nMessage me with your ideas and we can create something tailored for your occasion!!\n \nTo begin your order, please follow the simple steps below…\n \nStep 1 | Select your Quantity and Shot Glass Ink Imprint Color and add to your cart.\nStep 2 | Proceed to check out.\nStep 3 | In the “Notes To Seller” box please include the following…\n\n          - Type of Event\n          - Event Date\n          - Event Location\n          - Imprint/Ink Color Selection ( see chart in listing - 1 per order )\n          - Anything you would like customized can be included here as well!\n\nStep 4 | Your proof will be sent via the email address listing on your Etsy Account. Please verify that it is up to date at check out. All proofs come from the email address orders@siphiphooray.com. Shot Glasses will not go into production until the approval is sent back to me on your final proof.\n \nWe do offer ‘Rush Production’. \nContact us for a quote and current production times if your event is approaching quickly!\n_____________________________\n \nShot Glass Specs\n* Capacity: 1.5oz\n* Material: Clear Glass\n* Pricing includes a 1 Color Print on 1 side\n* Imprint area is 1.5&quot;H x 1.75&quot;W\n* Hand washing recommended\n \n**  Due to the custom nature of our product, all Shot Glass sales are final.\n*** Ink Colors are represented as accurately as possible. Due to variation between every monitor, smartphone and tablet display, seller is not responsible if the colors show differently in person.\n \nIf you have any questions, please do not hesitate to contact us!",
