        "title": "Wedding Can Coolers, Design, Printing and Party Goods",
        "announcement": "Sip Hip Hooray offers a fun and exciting selection of personalized wedding can coolers and party goods, invitations and stationery products with something for every budget and taste. Adding creative touches to the most important and memorable events in your life!\r\n\r\nWedding Can Coolers, Custom Party Can Coolers, Baby Showers, Birth Announcements, Birthday Parties, Christmas Cards, Holiday Party&#39;s, Thank You&#39;s, Moving Announcements, Wedding Stationary {save the date cards, menus, programs, place settings & shower invitations} Personalized Stationary, Desk Top Stamps and much more!",
        "currency_code": "USD",
        "is_vacation": false,
        "vacation_message": null,
        "sale_message": "Thank you so much for your purchase!\r\nI am looking forward to adding special touches to your big day!\r\nPerhaps we have already begun our communications, if so, that’s fantastic! If not, please feel free to reach out to me at any time.\r\n\r\nThank you again from all of us at SipHipHooray!!!\r\nMeagan",
        "digital_sale_message": null,
