        "login_name": "meaganadair",
        "accepts_custom_requests": true,
        "policy_welcome": "Thank you for visiting Sip Hip Hooray! We are happy that you have stopped by. Design is our passion and we love sharing it with the world!\r\n\r\nOur shop hours are Monday-Friday 8am-5pm central time.\r\n\r\nNOTE: Although I do have a tendency to respond outside of shop hours, sometimes our order volume is higher than others and your response can take up to 24 hours and may only be during the parameters of our business hours. ",
        "policy_payment": "Sip Hip Hooray only accepts Paypal and credit cards through Etsy for purchases. We do not accept checks or money orders.\r\n\r\nPayment is due at the time of purchase. If payment is not received within 24 hours, your transaction will be canceled and the item will be re-listed. \r\n \r\nDIGITAL FILES + INVITATIONS | Custom or Template - Purchase of listing or deposit must be processed before the creative and proofing process begins. Proofs will be sent to your Etsy account. All information must be provided to us for work to begin. The file provided to you will be a High Resolution JPG. I can add bleeds or change up file size per your request if your printer has specific set up requirements. When you receive your proof you will be asked to submit your revisions. Please check thoroughly for misspelling, correct colors, punctuation, capitalization, all information on design, etc. Once approved, we are not responsible for an errors. ***Your order WILL NOT print until your proof is approved.\r\n\r\nCHANGES | We strive to satisfy every customer 110%. I do not have a max on changes and am willing to work with you until you are completely satisfied. ",
        "policy_shipping": "DIGITAL DESIGN | All digital pieces are delivered to the email address on your Etsy account. Please make sure it is correct, we do not always cross reference your Etsy email address with your Paypal email address. If needing delivery to a different email address, please leave it in the &quot;note to seller&quot; box upon checkout.\r\n\r\nPRINTED INVITATIONS | All shipping is ground shipping, 3-5 business days. From the time of approval, please allow 1-3 business days for pieces to process through printing and ship.\r\n\r\nCAN COOLERS, CUPS AND NAPKINS | Please allow 2-3 weeks from the time of final proof approval for normal production and shipping turnaround.\r\n\r\nAll orders are shipped to the address on your PAYPAL/Etsy account.  We ask that you verify that the address listed is your correct and current shipping address before submitting your order.\r\n\r\nWe are not responsible for packages that are shipped to the wrong address due to inaccurate information provided or packages that are lost in the mail.\r\n\r\nA Rush Production and Shipping option is available for an additional fee. Please inquire for pricing.\r\n\r\nWe are not liable for late deliveries due to postal shipping delays, or color variations due to computer monitors.\r\n\r\nAdditional Estimated Shipping for outside the Continental United States.\r\n\r\n** Please note that upon receipt of your custom proofs it is necessary to respond with changes and/or approval within 24-48 hours to avoid additional rush shipping costs if applicable according to your necessary in-hand date.",
        "policy_refunds": "All products are custom designed and printed upon client approval, therefore we do not accept returns. However, if there is an error on our part, we will gladly send a replacement that correctly reflects your order or refund the order amount.\r\n\r\nWe do not refund shipping.\r\n\r\n** CHECK YOUR PROOFS carefully. We are not responsible for any errors (spelling, wrong information, etc) after the proof has been approved by you and the order has been printed. There will be a charge for re-printing. **\r\n\r\nPRINT COLOR | Please note that colors can vary slightly due to the monitor they are viewed on.\r\n",
        "policy_additional": "We thrive on custom work. Please message us with any requests and we will be happy to work towards your print and design wants and needs with you. We are full service stationery as well as corporate design and printing company. Some of our additional products include but are not limited to...\r\n\r\nWEDDING\r\nEngagement Party\r\nSave the Dates\r\nWedding invitation\r\nBridal Shower\r\nCouples Shower\r\nWedding Announcements\r\nRehearsal Dinner\r\nBachelorette Party\r\nBachelor Party\r\n\r\nAddressing\r\nMailing Service\r\n\r\nWedding Essentials\r\nWedding Party Cards\r\nPrograms\r\nMenus\r\nPlace Cards\r\nEscort Cards\r\nTable names/Numbers\r\nCandy Table Signage\r\nGuest Book Table Signs\r\nAdvice Cards\r\nRecipie Cards\r\nThank You Cards\r\nFavor Tags\r\n\r\nBIRTHDAY\r\nAdult\r\nKids\r\n\r\nBABY\r\nBaby Shower\r\nBirth Announcements\r\nEmbroidering \r\n\r\nCORPORATE\r\nCorporate Events\r\nBanners\r\nBusiness\r\nBusiness Cards\r\nPost Cards\r\nPress Packages\r\nComplete Branding\r\nLogos\r\nWebsite Design\r\nPromotional Materials\r\nEmbroidering \r\nCompany Event Invitations\r\n\r\nLifetime Celebrations\r\nGraduation\r\nRetirement\r\nAnniversary\r\n\r\nSocial Stationery\r\nThank You Cards\r\nNote Cards\r\nLetterhead\r\nMoving Announcements\r\n\r\nHOLIDAY\r\nPersonalize Your Christmas Cards\r\nPhoto Cards\r\nParty Invites\r\nOpen House\r\n\r\nFor all printed invitations and announcements, there is a minimum order of 25 pieces. For business cards, the minimum is 100. \r\n\r\nDISCLAIMER \r\n\r\nBy visiting Sip Hip Hooray shop, you agree that you will not copy, print, download or otherwise reproduce any part of Sip Hip Hooray&#39;s products by any means without consent/purchase. When submitted photos for use, you are stating that you have all appropriate consent from your photographer to reproduce a printed piece using that image, be that written or verbal, and Sip Hip Hooray is not responsible for any legal matters. \r\n\r\nCUSTOM ARTWORK / INTELLECTUAL PROPERTIES POLICIES -\r\n\r\nWe have SOLE OWNERSHIP of any and all designs we create, including Custom Designs.\r\n\r\nWe reserve the right to SHARE any and all designs we create, including Custom Designs, on all social media.\r\n\r\nWe reserve the right to SELL any and all designs we create, including Custom Designs, in any of our retail outlets including our online stores.",
