        "accepts_custom_requests": false,
        "policy_welcome": "Hi-dee-ho there, hep cats and cool chicks!  Welcome to DollyBird Vintage!",
        "policy_payment": "I accept Credit Cards, Paypal, and Etsy Gift Cards!  \r\nPayment is expected at time of purchase.",
        "policy_shipping": "At the moment, I only ship within the continental USA, Canada, Australia.  Unfortunately, due to current EU regulations that create headaches and much hassle for sellers, we will no longer ship to the UK or any other country in the European Union.\r\n\r\nWithin the Continental US, I ship USPS Priority.  Packaging costs, insurance, and tracking are included. \r\nInternationally, the price is based on shipping USPS First Class International.\r\n\r\nYour new play pretty will be on it&#39;s way to you within 1-3 working days of received payment unless otherwise stated.  Shipping overages of $2 (US) or more will be refunded.\r\n\r\nDollyBird is not responsible for any customs fees, import taxes, or if the shipping address you&#39;ve given is not correct.  If your paypal and Etsy addresses don&#39;t match, please specify in your order what address to ship the item to!\r\n\r\nAgain, we are not responsible for custom fees or import taxes/VAT on international purchases.  The buyer is responsible for ANY additional fees that may arise in their country as the buyer is considered the &#39;importer&#39;. \r\nAlso, please be aware that items can sometimes be held up in customs for days or even weeks.",
        "policy_refunds": "Most of my items are vintage or made from vintage materials that are 40 years old and older.  This means that they will usually have a small amount of  wear and tear.  \r\n\r\nAll the items I sell are in Good to Excellent vintage condition and are things I would be thrilled to own myself...if I wouldn&#39;t use it or wear it, I won&#39;t sell it!  Most items will have been laundered prior to listing except in the case of items that require dry cleaning.  I will check carefully for flaws and list any I find in the description of the item.  If you would like additional photos of flaws mentioned in a listing, just ask!  \r\n\r\nPlease read descriptions carefully as they will contain approximate sizing, vintage, modern, or both, as well as actual measurements.  If you aren&#39;t sure of your size, please check the measurements listed against a similar garment you own and love to get a better idea of how it might fit you!\r\n\r\nIf you have any additional questions/clarifications about any item that aren&#39;t answered in the description, please convo me and I&#39;ll be more than happy to give you extra details as well as take as many extra pics as you need!  DollyBird wants you to make an informed purchase that you&#39;ll be ecstatic about! \r\n\r\nIf you are unhappy with your purchase, please convo me!  Returns must be initiated within 14 days of receipt of item. Item price, less original shipping charge will be refunded only after returned item is received in it&#39;s original list condition. Customer is also responsible for return shipping cost, except in the unlikely event an item received is not the item purchased.",
        "policy_additional": "I will from time to time offer &#39;new&#39; replicas and/or copies of vintage pieces as well as the occasional toile/sample.  This will be clearly stated in the description along with sizing of the item.  At this time, I do not take special orders for additional sizes of these items.  For the moment, they will be offered on an &#39;as seen&#39;/&#39;one off&#39; basis.\r\n\r\nDollyBird Vintage\r\nGreeneville, TN\r\n\r\nFind us on Facebook @\r\nwww.facebook.com/DollyBirdRetroVintage",
